import { useState } from "react";

const CatPic =()=>{

    const [loaded,setLoaded]=useState(false)
    
    if(!loaded)
    return (
    <div>
        <b>Pics of cats will be here!</b>
    </div>   
    );

    useEffect(() => {
        const load = async () => {
          try {
            const resp = await axios(
              "https://cat-fact.herokuapp.com/facts"
            )
            setFacts(resp.data)
            setLoaded(true)
          } catch (err) {
            console.log(err)
          }
        }
    
        if (!loaded) {
          load()
        }
      }, [])
}

export default CatPic;
